import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Register from "./pages/Register";
import Login from "./pages/Login";
import CarDashboard from "./pages/Dashboard";
import AddCar from "./pages/AddCar";
import NoPage from "./pages/NoPage";
import CryptoJS from "crypto-js";
import React from "react";

const salt = "a_random_salt_value";

function encryptUrl(url) {
    const valueToEncrypt = salt + url;
    const encryptedValue = CryptoJS.SHA256(valueToEncrypt).toString();
    return encryptedValue;
  }

  function encryptEditUrl(url, id) {
    const valueToEncrypt = salt + url + id;
    const encryptedValue = CryptoJS.SHA256(valueToEncrypt).toString();
    return encryptedValue;
  }

  function App() {
    return (
      <BrowserRouter>
        <Routes>
          <Route index element={<Register />} />
          <Route path={"/add"} element={<AddCar />} />
          <Route path={"/login"} element={<Login />} />
          <Route path={"/admin"} element={<CarDashboard />} />
       <Route
  path={encryptEditUrl("/add/:id", ":id")}
  element={<AddCar isEdit={true} />}
/>

          <Route path={encryptUrl("*")} element={<NoPage />} />
        </Routes>
      </BrowserRouter>
    );
  }


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
